import * as React from 'react'
import styled from 'styled-components';
import Page from '../components/page/page';

const Title = styled.h1`
  font-size: 3rem;
  color: ${props => props.theme.primary};
`;

const Index = () => (
    <Page>
        <section></section>
    </Page>
);

export default Index;
